import {
    MODULE_LIST,MATERIAL_LIST
} from '../util/ModuleConstants';

export function storeModules(data) {
    return {
        type: MODULE_LIST,
        payload: data
    };
};


export function storeMaterials(data) {
    return {
        type: MATERIAL_LIST,
        payload: data
    };
};
